const _stylesBar = {
    pin_container: {
        margin: 0,
        padding: 0,
        width: '200px',
        height: '200px',
        backgroundColor: 'red',
        position: 'absolute',
        left: '50%',
        transform: 'translateX(-50%)',
        display: 'grid',
        gridTemplateColumns: 'repeat(auto-fill, 250px)',
        gridAutoRows: '10px',
        justifyContent: 'center',
        },
    };

function PinBar() {
    return (
        <div style={_stylesBar.pin_container}>
            
